import TextRecognition from 'react-native-text-recognition';
import {launchImageLibrary} from 'react-native-image-picker';


const App = ()=> {

          const [image, setImage] = useState(null);


          useEffect(() => {

            launchImageLibrary({},setImage);
          }, []);

          useEffect(() => {

              if (image)
                {
                  console.log(image);
                }
              },[image]);




    return (
      <SafeAreaView>
        <StatusBar/>
